1) I don't mean creating public method which will just serve as a wrapper to private method.

but public methods are calling private methods, right? so if we'll test public methods than private methods will be tested as well. in other words if there is a mistake in private method, than public method, which uses it, will work incorrectly and UT for public method will fail.

2) nothing. but consider following code

class A
{
public:
  <some methods> 
private:
  std::vector<Data> dataList;
};

what prevents user from creating instance of std::vector outside of the class? nothing, right? is it a problem? I can't see why.

Encapsulation is not a mechanism to forbid programmers to touch some part of the code. it is a mechanism to keep objects internal state to be valid at all times - only class itself can change it and it guarantees that it will change it in a valid and predictable way. 

if some other part of the code wants to reuse one of the internal structures (which also guarantee to keep their own state valid and are tested by UTs), than I can't see any problem

There are two possible solutions:
1) test private methods through public interface
2) extract private methods to a separate class and make them public there so they can be tested. use this class as a private field in the original class. i.e.

class A
{
public:
  void bar() { foo(); }
private:
  void foo();
};

can be converted to

class A
{
public:
  void bar() { b.foo(); }
private:
  B b;
};

class B
{
public:
  void foo();
};

This way we can test method foo() and it is still encapsulated in class A

extract arm_cortexa53_rt and the #else branch into separate methods of the same name. excessive use of #if-#else inlined into methods harms code readability. For example: try:


  #if defined(ARCHITECTURE_arm_cortexa53_rt )
  void Application::createSubinstances()
  {
    subinstances[0] = new Subinstance( Core::RT_CORE_6, Core::RT_CORE_7, ARM_SUBINSTANCE_0 );
    subinstances[1] = new Subinstance( Core::RT_CORE_8, Core::RT_CORE_9, ARM_SUBINSTANCE_1 );
    subinstances[2] = new Subinstance( Core::RT_CORE_10, Core::RT_CORE_11, ARM_SUBINSTANCE_2 );
    subinstances[3] = new Subinstance( Core::RT_CORE_12, Core::RT_CORE_13, ARM_SUBINSTANCE_3 );
  }

  #else
  void Application::createSubinstances()
  {
    subinstances[0] = new Subinstance( Core::RT_CORE_2, Core::RT_CORE_3, ARM_SUBINSTANCE_0 );
    subinstances[1] = new Subinstance( Core::RT_CORE_1, Core::NON_RT_CORE, ARM_SUBINSTANCE_1 );
  }



And then within Application::Application(), just call creatSubinstances(); That way you've separated common code from the differences between deployments.

